import tkinter as tk
import base64
import string
import os


#flag{Sze_yes}

def ba_se():
    code = entry.get()
    flag = entry2.get()
    if (len(code) == 64):
        print("编码正确")
    else:
        print(f"解码错误: {code}长度不为64")
        label.config(text=f"解码错误: {code}长度不为64")
    coder = str.maketrans(code, "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789==")

    try:
        print(flag.translate(coder))
        print(base64.b64decode(flag.translate(coder)))
        label.config(text=f"{base64.b64decode(flag.translate(coder))}")
    except base64.binascii.Error as e:
        print(f"解码错误: {e}")
        label.config(text=f"解码错误: {e}")



img=b''

root = tk.Tk()
root.geometry("600x300")
root.title("base64换码程序")
tmp = open("tmp.ico","wb+")#创建临时文件
tmp.write(base64.b64decode(img))#写入到临时文件中
tmp.close()#关闭文件
root.iconbitmap("tmp.ico") #设置图标
os.remove("tmp.ico")#删除临时文件
#root.iconbitmap('T.ico')
#root.tk.call('wm', 'iconphoto', root._w, tk.PhotoImage(file='hua.png'))
#root.iconphoto(False, tk.PhotoImage(file='hua.png'))
label = tk.Label(root, text="base64换码表")
label.pack(pady=10)
button = tk.Button(root, text=" 转换 ", command=ba_se)
button.pack(pady=10)
entry = tk.Entry(root)
entry.config(width=50)
entry.pack(pady=20)
entry2 = tk.Entry(root)
entry2.pack(pady=15)
root.mainloop()

